import React from 'react'
import {Link, Outlet} from 'react-router-dom'

const HomePage = () => {
  return (
    <>
    <ul>
      <li><Link to="/login">Login</Link></li>
      <li><Link to="Register">Register</Link></li>
    </ul>
    <Outlet />
    </>
  )
}

export default HomePage;
